import React from "react";
import "./Header.css";
import Calc1 from "./Calc1";
import Calc2 from "./Calc2";
import Calc3 from "./Calc3";
import { useState } from "react";

function Header() {
  const [activeCalculator, setActiveCalculator] = useState("Calc1");

  const renderCalculator = () => {
    switch (activeCalculator) {
      case "Calc1":
        return <Calc1 />;
      case "Calc2":
        return <Calc2 />;
      case "Calc3":
        return <Calc3 />;
      default:
        return <Calc1 />;
    }
  };
  return (
    
    <div className="Header">
      <h1>Калькулятор финансов</h1>
    </div>
  );
}

export default Header;
